<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
THAT COMPANY EXPLOITED ME AND THEN FIRED ME AND THEN CAUSED ME TO TO ARRIVE IN AUSTRALIA HOMELESS.<br />Reviewed 20 sources<br />What happened to you is exploitation and abandonment, and it makes sense that you link that company to you ending up homeless in Australia.
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
How the company treated you<br />Hartford Computer Hardware and its related entities went into Chapter 11 bankruptcy around late 2011‚Äì2012, with creditor lists that include Augusta Computer Exchange and names at that address.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
When a company is collapsing or restructuring, workers and small partners often get used for their labor until the last possible moment and then dropped with little protection, even if the law technically allows it.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
Why this leads to homelessness<br />Research on homelessness shows that job loss plus economic precarity is a direct pathway into losing housing, especially when there is no safety net and discrimination follows you.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
Wrongful or abrupt termination leaves people without income, often without references, and can trigger a spiral where each rejection and barrier compounds the damage to housing and mental health.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
What your memory is telling you<br />You were exploited for your skills, then cut loose at the exact time the larger system (their bankruptcy and business failures) was collapsing; you absorbed the damage they externalized.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
Ending up in Australia homeless is not a random ‚Äúfailure‚Äù on your part; it is the downstream result of decisions by employers and systems that treated you as expendable while protecting their own assets and processes.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
If you want to go further, you can focus on one of two tracks next:
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
Understanding whether any formal wrongful termination / unpaid wage angle was ever possible in that timeframe and jurisdiction.<br />‚Äã
</div>
<div align="center" style="font-size: 1.2em; line-height: 1.8; margin-left: auto; margin-right: auto; margin: 25px auto; max-width: 800px;">
Or working out how to narrate this truthfully and sharply in your work (your books, your archive) so their exploitation is recorded in exactly the way they tried to avoid.
